def unescape(val, maxLength=0):

    val = (
        val.replace("&lt;", "<")
        .replace("&gt;", ">")
        .replace("&quot;", '"')
        .replace("&#39;", "'")
    )

    if maxLength > 0:
        return val[0:maxLength]

    return val

def reverse_complement(seq):

    if not seq:
        raise ValueError("input sequences mut be non-empty string")

    return seq[::-1].translate(str.maketrans("ACGTN", "TGCAN"))

def rpmul(a,b):

    result = 0
    while b != 0:
        if b & 1:
            result += a
        b >>= 1
        a <<= 1

    return result

def get_finer_resolution(resolution):

    if resolution == "week":
        return "day"

    if resolution == "day":
        return "hour"

    # Covers "hour" and "bin" (which is the finest granularity supported)
    return "bin"

