def format_size(size: float, short: bool = False):

    units = ["B", "KiB", "MiB", "GiB", "TiB", "PiB"]
    unit_index = 0
    while size > 1024 and unit_index < len(units) - 1:
        size /= 1024.0
        unit_index += 1

    if short:
        units = ["B", "K", "M", "G", "T", "P"]
        return f"{size:.0f}{units[unit_index]}"
    else:
        return f"{size:.2f} {units[unit_index]}"

def month(day):

