def lpsigmoid(input, alpha=0.5, beta=1.0, inplace=False):
    r
    if inplace:
        x = input.mul(1.0-alpha)
        if beta == 1.0:
            return input.add_(input.sigmoid().mul_(alpha)).add_(x)
        return input.mul(beta).sigmoid_().mul_(alpha).add_(x)
