def aia_locator_gen(prepped_map):

    aia_obs = prepped_map.coordinate_frame.obstime.datetime

    yr = aia_obs.year
    mth = aia_obs.month
    day = aia_obs.day

    hour = aia_obs.hour
    mn = aia_obs.minute

    if day < 10:
        day = f"0{day}"
    else:
        day = day

    if hour < 10:
        hour = f"0{hour}"
    else:
        hour = hour

    if mn < 10:
        mn = f"0{mn}"
    else:
        mn = mn

    locator = f"{yr}-{mth}-{day}_{hour}:{mn}"

    return locator

def num_features(game):

  return (game.information_state_normalized_vector_size() +
