def use_edge_def_or_num(given_value, default_func):

    # Default: use pre-defined function from this module
    if given_value is None:
        func = default_func
    # Transform: value to function that returns the value
    elif isinstance(given_value, (int, float)):
        given_value = float(given_value)

        def func(atom1, atom2):
            return given_value
    # Passthrough: value itself is a function
    else:
        func = given_value
    return func

def usn_in_range(usn, range):


    idx = 0
    cont = True
    ok = False
    while cont:
        if idx ==  len(range):
            cont = False
            continue
        if usn < int(range[idx]):
            if idx %2 == 1:
                ok = True
            cont = False
        if usn == int(range[idx]):
            cont = False
            ok = True
        idx = idx + 1
    return ok

def bottom_screen_edge(desktop, rect):

    p1 = rect.bottomLeft()
    p2 = rect.bottomRight()
    g1 = desktop.availableGeometry(p1)
    g2 = desktop.availableGeometry(p2)
    return min(p1.y(), g1.bottom(), g2.bottom())

def distributeN(comm,N):


    P      = comm.size
    rank   = comm.rank
    rstart = 0
    rend   = 0
    if P >= N:
        if rank < N:
            rstart = rank
            rend   = rank + 1
        else:
            rstart = rank
            rend   = rank
    else:
        n = N/P
        remainder = N%P
        rstart    = n * rank
        rend      = n * (rank+1)
        if remainder:
            if rank >= remainder:
                rstart += remainder
                rend   += remainder
            else: 
                rstart += rank
                rend   += rank + 1    
    return rstart, rend

